function dist(lat1, lng1, lat2, lng2) {
  var p = 0.017453292519943295;
  var c = Math.cos;
  var a = 0.5 - c((lat2 - lat1) * p)/2 +
          c(lat1 * p) * c(lat2 * p) *
          (1 - c((lng2 - lng1) * p))/2;
  return 0.621371 * (12742 * Math.asin(Math.sqrt(a)));
}

